import './App.css';
import { Dropdown } from 'primereact/dropdown';


function App() {

  const [userOptions, setUserOptions] = useState([]);
  const [selectedUser, setSelectedUser] = useState(null);

  useEffect(() => {
    // Realizar la solicitud GET a tu API para obtener los datos de usuario
    axios.get('http://localhost:8080/user')
      .then(response => {
        // Una vez obtenidos los datos, actualizar el estado con las opciones de usuario
        setUserOptions(response.data);
      })
      .catch(error => {
        console.error('Error al obtener los datos de usuario:', error);
      });
  }, []);


  return (
    <div className='container'>
    <div className='form-container'>
      <div className='form'>
      <h4 className='form-h4'>Please choose your name</h4>
      <Dropdown optionLabel="user" 
        placeholder="Select " className="w-full md:w-14rem" />


      </div>
    </div>
  </div>
  );
}

export default App;
